            characterSpritesRunningLeft[0] = standardRunningLeft[0]
            characterSpritesRunningLeft[1] = standardRunningLeft[1]
            characterSpritesRunningLeft[2] = standardRunningLeft[2]
            characterSpritesRunningLeft[3] = standardRunningLeft[3]
            characterSpritesRunningLeft[4] = standardRunningLeft[4]
            characterSpritesRunningLeft[5] = standardRunningLeft[5]
            
            characterSpritesRunningRight[0] = standardRunningRight[0]
